import React from 'react';

import {Route, Redirect} from 'react-router-dom';

export default function PrivateRoute({user, component: Component, data, ...rest}){
    return(
        <Route {...rest} render={
            props=> (
                user ?
                    <Component data={data} {...props} />
                    :
                    <Redirect to="/" />     
            )
        } />
    );
}
